INSERT INTO `config` VALUES ('web', '网站信息配置', 'a:13:{s:4:\"code\";s:3:\"web\";s:7:\"support\";s:39:\"韶关市宇宸信息科技有限公司\";s:5:\"title\";s:12:\"智能仓库\";s:6:\"domain\";s:0:\"\";s:3:\"icp\";s:9:\"ICPXXXXXX\";s:6:\"qrcode\";a:1:{s:9:\"WU_FILE_0\";a:2:{s:4:\"path\";s:68:\"/xfzz/web/Attached/pic/20170212/f7fab4c7839bc8a48e0da7424bc585a7.png\";s:4:\"name\";s:7:\"QR_code\";}}s:5:\"weibo\";a:1:{s:9:\"WU_FILE_1\";a:2:{s:4:\"path\";s:68:\"/xfzz/web/Attached/pic/20170212/cea17bef2d3db20cc6fcd26f69e3c282.png\";s:4:\"name\";s:7:\"QR_code\";}}s:9:\"copyright\";s:57:\"copyright@2017 韶关市新丰县中等职业技术学校\";s:5:\"about\";s:5357:\"<p style=\"text-align:center\"><img src=\"/ueditor/php/upload/image/20170216/1487210524.jpg\" title=\"01职中校门.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; outline: none; box-sizing: border-box; max-width: 100%; display: block;\"/></p><p>&nbsp;</p><p style=\"text-align: center;\"><strong><span style=\"font-size: 36px;\">新丰县中等职业技术学校简介</span></strong></p><p style=\"text-align: left; text-indent: 2em;\">新丰县中等职业技术学校，创办于2003年秋季，是我县唯一的一所中等职业技术学校。校址最初选在丰城街道城东路校前街。2008年8月，县委县政府通过优化整合县城中学现有的教育资源，致力于扩大我县中等职业技术教育的办学规模，将我校迁址至紫城工业区。2008年秋，我校和深圳德昌电机公司建立校企深度合作关系，进行联合办学，在深圳德昌电机公司建设校舍，设立德昌班。</p><p style=\"text-align:center\"><img src=\"/ueditor/php/upload/image/20170216/1487210525.jpg\" title=\"1.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; outline: none; box-sizing: border-box; max-width: 100%; display: block;\"/></p><p style=\"text-align: left; text-indent: 2em;\">学校占地面积约63亩，建筑面积约1.3万平方米。现建有办公楼一栋，教学楼两栋、综合楼一栋、实训楼一栋、学生宿舍楼两栋、教师宿舍楼一栋，学生厨房一栋。功能场室配置比较完备。学校现有教职工61人，其中专业专任教师53人，双师型教师35人，高级职称4人，中级职称42人；现有在校学生1125人（含德昌分校），设在校本部有19个教学班，共有学生736，其中住宿生共有248人；德昌分校有12个教学班，共有学生389；我校开设有学前教育、数控机床技术及应用、电子电工应用技术、高职类高考班（3+证书）、电子商务、机电技术应用专业。根据省委省政府关于大力实施“双转移”战略的要求，县委县政府把学校列入我县劳动力转移培训基地，开设有会计电算化、电脑、文秘、中小型企业管理、（风）电焊工、电工、家政等专业短训班。</p><p style=\"text-align:center\"><img src=\"/ueditor/php/upload/image/20170216/1487210526.jpg\" title=\"2.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; outline: none; box-sizing: border-box; max-width: 100%; display: block;\"/></p><p style=\"text-align: left; text-indent: 2em;\">学校秉承致力于师生共同发展的理念，坚持改革创新，为师生职业成长和发展不断拓展空间，努力办出教育培训和企业培训并举培养特色，建立&nbsp;“岗位定向、专班培养”、“职业素养与职业技能并重”的职业教育特色。学校开展丰富多彩的校园文化活动，开设有篮球、羽毛球、乒乓球、文学社、心理咨询社、街舞等10多个社团活动，开设以学前教育专业为主带动其他专业乃至全体教师参与的以民族舞、广场舞为主要内容的大课间活动。每学期举办一次全校性的技能竞赛、文体活动，为每位学生提供展示自我、施展才华的平台，让学生进得来，留得住，学的好，出得去。</p><p style=\"text-align:center\"><img src=\"/ueditor/php/upload/image/20170216/1487210527.jpg\" title=\"3.jpg\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; outline: none; box-sizing: border-box; max-width: 100%; display: block;\"/></p><p style=\"text-align: left; text-indent: 2em;\">学校开办以来，本着厚德、笃学、勤练、创新的校训精神，在上级教育行政部门和县委县政府的正确领导下，经过全体师生的共同努力，在教育教学工作中取得了可喜的成绩。2006年首次参加高职类（3+证书）高考，至2015年十年间，上线率均名列全市前茅，保持在全市领先位置；学生参加各项技能考证通过率达90%以上。在韶关市开展教育教学管理工作检查评比中，多次被评为“韶关市教学常规管理工作先进单位”。在每年的市中职技能大赛上，所参加的各个项目均有不俗表现，成绩斐然；在参加每年韶关市举办的“中学生健美操大赛”竞技中，均取得好成绩。教师的课件、论文、课题研究等教科研作品分获国家级、省级、市级各项奖励。</p><p style=\"text-align: left; text-indent: 2em;\">目前，学校正不断加快改革发展的步伐，以省级重点职业技术学校的标准要求自己，力争把学校打造成为“新丰职业技术人才的摇篮”。</p><p><br style=\"text-align: left;\"/></p>\";s:3:\"tel\";s:14:\"020-8882019283\";s:7:\"address\";s:36:\"韶关市新丰县紫城工业园内\";s:3:\"lng\";s:10:\"114.191304\";s:3:\"lat\";s:9:\"24.046029\";}', '1477480389', '1534573025', null, null);
